                        <a className='paging prev-next' onClick={() => setPage(page+1)} disabled={page === pages || loading} >&raquo;</a>

            {/*<input type="number" value={page}  min="1" max={pages} onChange={(event) => setPage(event.target.value) }/>*/}
       </div>

    );
}
